import React from 'react'
import styled from 'styled-components';
import lines from '../assets/lines.png'
import ParallaxBackground from '../components/ParallaxBackground'

let what = ' \n \n P \n H \n A \n S \n E \xa0 \n \n O \n N \n E \n \n \n '

const Style = styled.div`


	display: flex;
	flex-direction: column;
	position: relative;
	width: 788px;
	margin-bottom: 50px;
	margin-left: auto;
	margin-right: auto;
	padding-top: 80px;


	&::before {
		position: absolute;
		left: 390px;
		margin-top: 110px;
		margin-left: auto;
		margin-right: auto;
		content:'${what}';
		width: 10px;
		white-space: pre-line;
		line-height: 5rem;
	}

	img {
		margin-top: 500px;
		top: 0;
	}
`;

function Timeline(props) {
	return (

		<Style>
			<img src={lines}></img>
			{props.children}
		</Style>

	)
}

export default Timeline;
